function expandProvider(compact: CompactProvider): NetworkProvider {
  return {
    name: compact[0],
    type: compact[1],
    address: compact[2],
    neighborhood: compact[3],
    city: compact[4],
    phone: compact[5],
    specialties: compact[6],
  };
}

// Função para obter prestadores por produto
export function getProvidersByProduct(productId: string): NetworkProvider[] {
  const compact = COMPACT_DATA[productId] || [];
  return compact.map(expandProvider);
}

// Função para obter todos os produtos disponíveis
export function getAvailableNetworks(): string[] {
  return Object.keys(COMPACT_DATA).filter(k => COMPACT_DATA[k].length > 0);
}

// Função para buscar prestadores
export function searchProviders(
  productId: string,
  query: string,
  filters?: {
    city?: string;
    neighborhood?: string;
    type?: string;
    specialty?: string;
  }
): NetworkProvider[] {
  let providers = getProvidersByProduct(productId);
  
  if (query) {
    const lowerQuery = query.toLowerCase();
    providers = providers.filter(p => 
      p.name.toLowerCase().includes(lowerQuery) ||
      p.neighborhood.toLowerCase().includes(lowerQuery) ||
      p.city.toLowerCase().includes(lowerQuery) ||
      p.specialties.some(s => s.toLowerCase().includes(lowerQuery))
    );
  }
  
  if (filters?.city) {
    providers = providers.filter(p => 
      p.city.toLowerCase().includes(filters.city!.toLowerCase())
    );
  }
  
  if (filters?.neighborhood) {
    providers = providers.filter(p => 
      p.neighborhood.toLowerCase().includes(filters.neighborhood!.toLowerCase())
    );
  }
  
  if (filters?.type) {
    providers = providers.filter(p => 
      p.type.toLowerCase().includes(filters.type!.toLowerCase())
    );
  }
  
  if (filters?.specialty) {
    providers = providers.filter(p => 
      p.specialties.some(s => s.toLowerCase().includes(filters.specialty!.toLowerCase()))
    );
  }
  
  return providers;
}

// Função para obter cidades únicas de um produto
export function getUniqueCities(productId: string): string[] {
  const providers = getProvidersByProduct(productId);
  const cities = new Set<string>();
  providers.forEach(p => {
    if (p.city) cities.add(p.city);
  });
  return Array.from(cities).sort();
}

// Função para obter bairros únicos de um produto (filtrado por cidade)
export function getUniqueNeighborhoods(productId: string, city?: string): string[] {
  let providers = getProvidersByProduct(productId);
  if (city) {
    providers = providers.filter(p => p.city.toLowerCase().includes(city.toLowerCase()));
  }
  const neighborhoods = new Set<string>();
  providers.forEach(p => {
    if (p.neighborhood) neighborhoods.add(p.neighborhood);
  });
  return Array.from(neighborhoods).sort();
}

// Função para obter especialidades únicas de um produto
export function getUniqueSpecialties(productId: string): string[] {
  const providers = getProvidersByProduct(productId);
  const specialties = new Set<string>();
  providers.forEach(p => p.specialties.forEach(s => specialties.add(s)));
  return Array.from(specialties).sort();
}

// Função para obter tipos de estabelecimento únicos
export function getUniqueTypes(productId: string): string[] {
  const providers = getProvidersByProduct(productId);
  const types = new Set<string>();
  providers.forEach(p => {
    if (p.type) types.add(p.type);
  });
  return Array.from(types).sort();
}

// Função para contar prestadores por produto
export function getProviderCount(productId: string): number {
  return (COMPACT_DATA[productId] || []).length;
}

// Função para obter estatísticas de um produto
export function getNetworkStats(productId: string): {
  total: number;
  cities: number;
  types: number;
  specialties: number;
} {
  const providers = getProvidersByProduct(productId);
  return {
    total: providers.length,
    cities: getUniqueCities(productId).length,
    types: getUniqueTypes(productId).length,
    specialties: getUniqueSpecialties(productId).length,
  };
}
